import React, { Component } from 'react';
import { Link } from "react-router-dom";
import GameSpace from './GameSpace.jsx';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';

class Home extends Component {

  state = {
    term: 2,
    approval: 40,
  }
  handleModeChange = (element) => {
      alert(element.target.checked)
    }

    render() {


        return (
          <div className="home">
          <img src="../pmcares.png" alt= "edit" width="650" height="200"/>
          <Link to="/gamespace">
          <button variant="outlined">
            Play
          </button>
          </Link>
          <FormControl component="fieldset">
          <RadioGroup name="mode1" value="Normal" onChange={this.handleModeChange}>
          <FormControlLabel value="Normal" control={<Radio />} label="Normal" />
          <FormControlLabel value="Quick" control={<Radio />} label="Quick" />
          </RadioGroup>
          </FormControl>
          </div>
        );
    }
}

export default Home;
